import React from "react";

function Car({ information }) {

    let carInformation = {
        id: information.id,
        model: information.carName,
        price: information.carPrice,
        images: [
            information.images
        ]
    }

  return (
    <div className="mx-[50%] w-full">
      <div></div>
      <div>{information.carName}</div>
      <div>{information.carName}</div>
    </div>
  );
}

export default Car;
